                return loader.getResources(name);
            } else {
                return ClassLoader.getSystemResources(name);
            }
        } catch (IOException e) {
            if (isDiagnosticsEnabled()) {
                logDiagnostic("Exception while trying to find configuration file " + name + ":" + e.getMessage());
            }
